// src/components/Experience.jsx
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Experience = () => {
  const [experiences, setExperiences] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:3001/api/experience')
      .then(res => setExperiences(res.data))
      .catch(err => console.error(err));
  }, []);
  
  return (
    <>
      <div>
        <ul class="Experience-list">
            <li>
                <img src="/assets/images/Intern.jpg" alt="Internship" className="w-64 h-40" />
                <p>Mobile Developer</p>
                <p>Internship</p>
                <p>Feb 2024 - June 2024</p>
                <a href="#evidence">Evidence</a>
            </li>
            <li>
                <img src="/assets/images/Research.jpg" alt="Researchsip" className="w-64 h-40" />
                <p>AI Developer</p>
                <p>Researchship</p>
                <p>Feb 2024 - June 2024</p>
                <a href="#evidence">Evidence</a>
            </li>
        </ul>
      </div>
    </>
  );
};

export default Experience;
